const SWAPI_ROOT = '1https://swapi.dev/api/';
const SWAPI_PEOPLE = 'people';

export const getApiResources = (url) => {
    fetch(url)
    .then(res => res.json())
    .then(body => console.log(body))
    .catch(error => console.log(error.message('YOO ERRORR')))
}

getApiResources(SWAPI_ROOT+SWAPI_PEOPLE);
